import React from "react"
import {
    CToaster,
    CToast,
    CToastHeader,
    CToastBody,
  } from '@coreui/react'



const ToastMe=()=>{
    return (
        <>
            <CToaster position="bottom">
            
                  <CToast
                
                    show={true}
                    autohide={"3000"}
                    fade={true}
                  >
                    <CToastHeader >
                      Toast title
                    </CToastHeader>
                    <CToastBody>
                      This is a toast
                    </CToastBody>
                  </CToast>
            </CToaster>
         
        </>
      )

}



export default ToastMe
